import React from 'react';
import PropTypes from 'prop-types';

const Account = props => {
    return (
        <div>
            <h1>Personal Information</h1>
            <div className='flex'>
                <div className='flex flex-col mb-5 xl:mb-0 xl:mr-6 xl:w-1/2'>
                    <Label>First Name</Label>
                    <Input
                        type={'text'}
                        placeholder={'First Name'}
                        id={'firstName'}
                        className={'bg-gray-100 text-indigo-700 w-full'}
                    />
                </div>
            </div>
        </div>
    );
};

Account.propTypes = {};

export default Account;
